(9, 1, '2020-04-09 16:07:06', '2020-04-09 14:07:06', '<!-- wp:paragraph -->\n<p>Saint Léonard est un noble franc légendaire qui aurait vécu à la cour de Clovis. Sa vie n\'est connue que par la tradition orale, relayée par une biographie très tardive.</p>\n<!-- /wp:paragraph -->', 'Culte de st Léonard en Europe', '', 'publish', 'closed', 'closed', '', 'culte-de-st-leonard-en-europe', '', '', '2020-04-20 14:50:21', '2020-04-20 12:50:21', '', 0, 'http://localhost/wp_cssl/?page_id=9', 0, 'page', '', 0),
