(197, 1, '2020-04-20 14:50:19', '2020-04-20 12:50:19', '<!-- wp:paragraph -->\n<p>Saint Léonard est un noble franc légendaire qui aurait vécu à la cour de Clovis. Sa vie n\'est connue que par la tradition orale, relayée par une biographie très tardive.</p>\n<!-- /wp:paragraph -->', 'Culte de st Léonard en Europe', '', 'inherit', 'closed', 'closed', '', '9-revision-v1', '', '', '2020-04-20 14:50:19', '2020-04-20 12:50:19', '', 9, 'http://localhost/wp_cssl/9-revision-v1/', 0, 'revision', '', 0),
